public void storeClaimTemplateField(Recid _recId, HMClaimEntity _entity)
{
    switch(_entity)
    {
        case HMClaimEntity::Patient:
            HMClaimTemplateFieldMappingPatient.HMClaimTemplateField =_recId;
            break;
        case HMClaimEntity::Carrier:
            HMClaimTemplateFieldMappingCarrier.HMClaimTemplateField =_recId;
            break;
        case HMClaimEntity::Diagnosis:
            HMClaimTemplateFieldMappingDiagnosis.HMClaimTemplateField =_recId;
            break;
        case HMClaimEntity::Physician:
            HMClaimTemplateFieldMappingPhysician.HMClaimTemplateField =_recId;
            break;
        case HMClaimEntity::Procedure:
            HMClaimTemplateFieldMappingProcedure.HMClaimTemplateField =_recId;
            break;
        case HMClaimEntity::Case:
            HMClaimTemplateFieldMappingCase.HMClaimTemplateField =_recId;
            break;
    }

}

public void init()
{
    super();

    this.queryBuildDataSource().addRange(fieldNum(HMClaimTemplate,TemplateType)).value(SysQuery::value(HMClaimTemplateType::CMS1500));
}

